import React from "react";
import "./card.css";

const Card = ({ imageSrc, followersCount, title }) => {
  return (
    <div className="card">
      <img src={imageSrc} alt={title} className="card-image" />
      <div className="card-content">
        <p className="card-followers">{followersCount} Follows</p>
        <h2 className="card-title">{title}</h2>
      </div>
      <img src={imageSrc} alt={title} className="card-image" />
      <div className="card-content">
        <p className="card-followers">{followersCount} Follows</p>
        <h2 className="card-title">{title}</h2>
      </div>
      <img src={imageSrc} alt={title} className="card-image" />
      <div className="card-content">
        <p className="card-followers">{followersCount} Follows</p>
        <h2 className="card-title">{title}</h2>
      </div>
    </div>
  );
};

export default Card;
